// This method takes in a String, which is parsed fromt the weather response
// and matches it to the corresponding bitmap byte array
const uint16_t * getIconBitmap(String iconId) {
    if (iconId.startsWith("submarine")){
        return submarine;
    } else if (iconId.startsWith("splash")){
        return splash;
    } else if (iconId.startsWith("frigate")){
        return frigate;
    } else if (iconId.startsWith("destroyer")){
        return destroyer;
    } else if (iconId.startsWith("cruiser")){
        return cruiser;
    } else if (iconId.startsWith("battleship")){
        return battleship;
    } else if (iconId.startsWith("carrier")){
        return carrier;
    } else {
        return NULL;
    }
}
